import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import { IMAGES } from 'shared/constants/stringConstantsSelectors';

export const Item = props => {

    const {
        id,
        imageURL,
        name,
        type,
    } = props.item;

    const imageSource = props.realImages ?  imageURL : IMAGES.FILL_MURRAY;

    return (
        <div>
            { props.item ? (
                <Card style={{ margin: 5 }}>
                    <CardMedia 
                        style={{ paddingTop: '60%', height: '250px', textAlign: 'top' }} 
                        image={imageSource}
                        title={id}
                    />
                    <CardContent>
                        <Typography gutterBottom variant='h5' component='h2'>{name}</Typography>
                        <Typography component='p'>{type}</Typography>
                    </CardContent>
                </Card>
            ) : null}
        </div>
    );
};
